  true,\n\t\"url\": null,\n\t\"notes\": \"This effort undertakes the creation of an
  Airport Ground Resource Planning (AGRP) tool.  Little or no automation is currently
  available to support airport ground resource allocation decisions.  The AGRP tool
  provides visualization both of the resource assignments as well as other information
  relevant to making resource assignment decision.  In addition, AGRP automates or
  advises resource assignments, improving efficiency while reducing workload.  In
  Phase 2, we propose to continue development of the AGRP tool through four work areas.
  \ First, we will complete the map and Resource Allocation displays.  We will also
  complete the algorithm to automate resource allocation decisions and integrate it
  with the displays.  The resulting AGRP prototype will be evaluated operationally.
  \ We will also extend the Phase 1 work to develop a block out time predictor, which
  would have tremendous application and benefit in other traffic management systems.
  \ In Phase 1, we proposed an architecture in which applications such as AGRP can
  subscribe to receive SMS data via a standardized interface.  In Phase 2 we will
  complete the specifications for and implementation of this interface, which will
  replace the existing SMS client-server communication.\",\n\t\"license_title\": \"U.S.
